                            <div class="elementor-element elementor-element-080fd25 elementor-widget elementor-widget-text-editor" data-id="080fd25" data-element_type="widget" data-widget_type="text-editor.default">
                                <div class="elementor-widget-container" style="font-family: 'Caveat', cursive; font-size: 18px; font-weight: 600;">
                                    गवती चहा ही वनस्पती पोएसी (गॅमिनी) कुलातील असून तिचे शास्त्रीय नाव सिंबोपोगॉन सिट्रेटस आहे. ही मूळची भारतातील असून समशीतोष्ण तसेच उष्ण प्रदेशांत वाढते. भारत, श्रीलंका, म्यानमार, थायलंड इ. देशांत ही प्रामुख्याने आढळते. या देशांत ती कोचीन ग्रास या नावाने ओळखली जाते. भारतात महाराष्ट्र, कर्नाटक आणि केरळ या राज्यांमध्ये गवती चहाची लागवड केली जाते. गवतासारखी वाढणारी ही बहुवर्षायू व एकदलीय वनस्पती १.५-२ मी. उंच व झुबक्यांनी वाढते. खोड ( मूलस्तंभ ) आखूड व जमिनीत वाढते आणि काही भाग जमिनीवर येतो. मुळे आखूड, तंतुमय आणि मोठ्या संख्येने व दाटीवाटीने वाढलेली असतात. पाने (पाती) १-१.५ मी. लांब, टोकाला निमुळती होत गेलेली आणि हिरवी असतात. ऊर्ध्वपातन पद्धतीने पानांतील तेल काढले जाते. या तेलात सिट्रल, सिट्रोनेलॉल, मिरसीन आणि निरोल हे घटक आहेत. तेल सारक, उत्तेजक, शामक असल्यामुळे जंतनाशक, रेचक, उपदंश, त्वचाविकार, कुष्ठरोग, अपस्मार, पोटातील वात वगैरे विकारांवर उपयुक्त आहे. कफ आणि वात विकारांवर या वनस्पतीचा उपयोग होतो. पानांचा काढा घाम आणणारा व ज्वरनाशक आहे. सुगंधी तेलाचा उपयोग सौंदर्य़प्रसाधनांत, तसेच अत्तर म्हणून होतो. साठवण आणि कीटकनाशक म्हणून पानांचा वापर करतात. गवती चहाला विविध भाषेत वेगवेगळी नावे आहेत, संस्कृत भाषेत सुगंध भूतृण, हिंदी भाषेत गंधबेना तर इंग्रजी भाषेत लेमनग्रास असे संबोधले जाते.
                                    <br>
                                    <br>
                                    गवती चहा ही उष्णकटिबंधीय व समशीतोष्ण प्रदेशांत वाढणारी एक सुवासिक तृणवर्गीय वनस्पती आहे. गवती चहा ही वनस्पती आशिया, आफ्रिका, युरोप, व ऑस्ट्रेलिया या खंडांत आढळते. गवतासारखी दिसणारी झुबकेदार एकदलीय वनस्पती १ ते २ मी. उंच वाढते. पाने टोकाला निमुळती होत गेलेली असतात. त्यांचा रंग हिरवा असतो. या रोपाचे खोड जमिनीत वाढते. गवती चहाची मुळे तंतुमय आणि दाटीवाटीने वाढलेली असतात. गवती चहा हे एक औषधी वनस्पती आहे. गवती चहाला बागेतील औषध असेही म्हणतात. हे बागेतील औषध घरोघरी पहायला मिळते. काही ठिकाणी गवती चहाच्या पानांना चहाची पात असेही म्हणतात. गवती चहाचे शास्त्रीय नाव Cymbopogon Citratus व इंग्रजी नाव Lemon Grass असे आहे. संस्कृतमध्ये हिला सुगंधीतृण, हिंदीत अग्याघास, गंधबेला, सिंधीमध्ये हरिचांय, तर बंगालीमध्ये गंधतृण म्हणतात. गवती चहा ही महाराष्ट्रात, कर्नाटकात, व केरळ मध्ये जास्त प्रमाणात आढळते. यांच्या पानांची लांबी १-१.५ मी लांब व टोकाला निमुळती होत गेलेली हिरव्या रंगाची असतात. गवती चहाचां अर्क बाजारात उपलब्ध असतो त्यास " ऑईल ऑफ व्हब्रेना " किंवा " इंडियन म्रेलिसा ऑइल " असे म्हणतात. गवती चहा बनविण्याच्या पद्धतीमध्ये या चहाच्या पानांचे तुकडे करून उखळत्या गरम पाण्यात टाकून त्यात चहा पावडर टाकली की दररोजच्या साध्या चहाला पण वेगळीच चव निर्माण होते व अश्या प्रकारे बनविण्यात आलेली चहा ही आरोग्यासाठी ही उपयुक्त असते.
                                </div>
